    data: |
      SELECT DISTINCT col0 + - col0 + - 91 AS col1 FROM tab0 AS cor0 WHERE NOT - 5 * 80 + - col0 + + 18 IN ( + col2, - col0 * - col1, col2 );
  - name: tab0

outputs:
  - name: q12143.out
    data: |
      -91
